import React from "react";
import d from './../Dialogs.module.css'
import DialogItem from "./DialogItem/DiaogItem";
import Message from "./Message/Message";


function Dialogs() {

    let dialogsData = [
        {id: 1, name: 'Dima'},
        {id: 2, name: 'Andrey'},
        {id: 3, name: 'Sveta'},
        {id: 4, name: 'Anna'},
        {id: 5, name: 'Petro'}]

    let messageData = [
        {id: 1, message: 'hi'},
        {id: 2, message: 'yo'},
        {id: 3, message: 'How are you?'},
        {id: 4, message: 'Do you know me?'},
        {id: 5, message: 'By by'}]

    let dialogsElement = dialogsData.map((dialog) => {
        return <DialogItem name={dialog.name} id={dialog.id}/>
    });

    let messageElement = messageData.map((mess) => {
        return <Message message={mess.message}/>
    })


    return (
        <div className={d.dialogs}>
            <div className={d.dialogsItems}>
                {dialogsElement}
            </div>
            <div className={d.messages}>
                {messageElement}
            </div>
        </div>
    );
}

export default Dialogs;
